exports=async function(bid,options){const{parseCatalog,hrefRecordRegex,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.ishubao.org/files/article/html/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="article_texttitleb"/,"</div>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};